import * as a from './StyledHeader.js';
import { useNavigate } from "react-router-dom";

function Header() {
  const navigate = useNavigate();

  const goToLogIn = () => {
    navigate("/LogIn");
  }

  const goToMain = () => {
    navigate("/LogIn");
  }
  
  return (
    <a.HeaderBox>
        <a.HeaderWrap>
            <a.Logo src={require('../../images/LogoWhite.png')} onClick={goToMain}/>
            <a.SearchBox/>
            <a.SearchSimbol src={require('../../images/searchSimbol.png')}/>
        </a.HeaderWrap>
        <a.NavWrap>
            <a.LoginBtn onClick={goToLogIn} >로그인</a.LoginBtn>
            <a.Page>마이페이지</a.Page>
            <a.Page>식단공유하기</a.Page>
        </a.NavWrap>
    </a.HeaderBox>
  );
}

export default Header;
